import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">

        <p className="App-story">
        My name is Pallo. I will be 21 years old in November 2022.
         I was born and raised in Johannesburg. My short term goal is to become a software developer. I have learned C++ and Python programing languages at the university. I am looking forward to learning other programming languages especially Java. I am also willing to work in any type of work environment, in South Africa and abroad. I am available for work from December 2022. My long term goal is to become a senior software engineer.
        </p>

      </header>
    </div>
  );
}

export default App;
